import React from "react";

const styles= {
    backgroundColor: "#ffc107",
    cursor: "pointer",
    outline: "none",
    border: "none",
    padding: "5px 10px",
    fontSize: "16px"
}

export const Button = (props) => {
    return <>
        <button style={styles}>{props.text}</button>
    </>

}
